import Nav from "./components/Nav";

const Home = () => {

    const authToken = true;

    const handledClick = () => {
        console.log("clicked");
    }

    return (
        <>
            <Nav />
            <div className="home">
                <h1>Swipe Right<span>&#174;</span></h1>
                <button className="primary-button" onClick={handledClick}>
                    {authToken ? "Signout" : "Create Account"}
                </button>
            </div>
        </>
    )
}
export default Home
